Django가 모델 정보를 가지고 할 수 있는 일. 이 앱을 위한 DB schzema 생성 (CREATE TABLE 문) Qustion 과 Choice 객체에 접근하기 위한 Python DB 접근 API를 생성 철학 Django 앱들은 꼈다뺐다 할 수 있음. 앱을 다수의 프로젝트에서 사용 가능하며 앱을 배포할 수도 있음. 특정 Django 사이트에 앱이 묶여있지 않아도 됨. 앱을 현재 프로젝트에 포함시키려면 앱의 구성 클래스에 대한 참조를 INSTALLED_APPS 설정에 추가해야 함. PollsConfig 클래스는 polls/apps.py 파일 내에 존재. 즉, polls.apps.PollsConfig. # mysite/settings.py INSTALLED_APPS = [ 'polls.apps.PollsConfig', 'django.contrib.admin', 'django.contrib.auth', 'django.contrib.contenttypes', 'django.contrib.sessions', 'django.contrib.messages', 'django.contrib.staticfiles',
] Django는 polls 앱이 포함 된 것을 알게됨. 다음 명령 실행. python manage.py makemigrations polls 실행 결과 Migrations for 'polls': polls/migrations/0001_initial.py - Create model Question - Create model Choice makemigrations을 실행시킴으로서, 모델을 변경시킨 사실과 이 변경사항을 migration으로 저장시키고 싶다는 것을 Django에게 알려줌. Migration은 Django가 모델(즉, DB 스키마)의 변경사항을 디스크에 저장하는 방법. Django가 mirgarion을 만들 때마다 읽진 않겠지만, Django의 변경점을 수동으로 수정할 수 있게 설계함. migration을 실행하고 DB 스키마를 관리해주는 migrate 명령어 실행. sqlmigrate 명령은 migration 이름을 인수로 받아, 실행하는 SQL 문장을 보여줌. python manage.py sqlmigrate polls 0001 실행 결과 BEGIN;
--
-- Create model Question
--
CREATE TABLE "polls_question" ( "id" serial NOT NULL PRIMARY KEY, "question_text" varchar(200) NOT NULL, "pub_date" timestamp with time zone NOT NULL
);
--
-- Create model Choice
--
CREATE TABLE "polls_choice" ( "id" serial NOT NULL PRIMARY KEY, "choice_text" varchar(200) NOT NULL, "votes" integer NOT NULL, "question_id" integer NOT NULL
);
ALTER TABLE "polls_choice" ADD CONSTRAINT "polls_choice_question_id_c5b4b260_fk_polls_question_id" FOREIGN KEY ("question_id") REFERENCES "polls_question" ("id") DEFERRABLE INITIALLY DEFERRED;
CREATE INDEX "polls_choice_question_id_c5b4b260" ON "polls_choice" ("question_id"); COMMIT; 사용 DB에 따라 출력결과 달라질 수 있으며, 위 출력결과는 PostgreSQL이 생성. 테이블 이름은 app(polls)과 모델의 소문자 이름이 결합해서 자동으로 생성됨. (아 동작을 override 가능.) Primary keys (IDs)는 자동으로 추가됨. (override 가능.) 컨벤션으로, Django는 "_id"를 외래키 필드명에 붙임. (override 가능.) 외래키 관계는 FOREIGN KEY 라는 제약에 의해 명시.

