1. 프론트엔드, 백엔드 기초 지식 쌓기. Technical Interview Guidelines for Beginners 의 프론트엔드와 백엔드 기초지식 일부를 읽었음. 자바스크립트를 해석하고 실행시키는 엔진 javascript를 해석하는 javascript engine과 웹 브라우저에 화면을 그리는 rendering engine(layout engine)은 다름. Rendering Engine (layout engine) : HTML과 CSS로 작성된 마크업 관련 코드들을 콘텐츠로서 웹 페이지에 'rendering'하는 역할 JavaScript Engine : JavaScript로 작성한 코드를 해석하고 실행하는 인터프리터. 주로 웹 프라우저에서 이용되지만 최근에는 node.js가 등장하면서 server side에서는 V8 과 같은 Engine이 이용됨. 구글에서 개발한 V8을 비롯한 대부분의 JavaScript Engine은 크게 세 영역으로 나뉨. Call Stack 단 하나의 call stack 사용 Run to Completion : 하나의 함수가 실행되면 이 함수의 실행이 끝날 때까지 다른 어떤 task도 수행될 수 없다는 의미. 요청이 들어올 때마다 해당 요청을 순차적으로 호출 스택에 담아 처리. Task Queue (Event queue) 자바스크립트의 런타임 환경에서는 처리해야하는 Task들을 임시 저장하는 대기 큐가 존재. Call stack이 비었을 때 먼저 대기열에 들어온 순서대로 수행. Heap 동적으로 생성된 객체는 힙에 할당됨. Hoisting 변수의 정의가 그 범위에 따라 선언과 할당으로 분리되는 것을 의미. 변수가 함수 내에서 정의되었을 경우, 선언이 함수의 최상위로, 함수 바깥에서 정의되었을 경우, 전역 컨텍스트의 최상위로 변경됨. 선언문은 자바스크립트 엔진 구동시 가장 최우선으로 해석되며, 할당 구문은 런타임 과정에서 이루어지기 때문에 호이스팅 되지 않음. 선언과 할당 function getX() { console.log(x); // undefined var x = 100; console.log(x); // 100
}
getX(); function getX() { var x; console.log(x); // undefined x = 100; console.log(x); // 100
}
getX(); Closure 외부 함수 호출이 종료되더라도 외부함수의 지역 변수 및 변수 스코프 객체의 체인관계를 유지할 수 있는 구조를 클로저라고 함. 외부 함수에 의해 반환되는 내부함수를 가리키는 말 let name = `Warning`;
function outer() { let name = `closure`; return function inner() { console.log(name); };
} let callFunc = outer();
callFunc();
// console> closure Promise 콜백이 중첩되는 경우가 발생했고, 이를 해결할 방안으로 등장한 것이 Promise 패턴. 비동기 작업들을 순차적으로 진행하거나 병렬로 진행하는 등의 컨트롤이 수월해짐. 예외 처리에 대한 구조가 존재하기 때문에 오류 처리 등에 대해 보다 가시적으로 관리할 수 있음. 공식문서 읽어보기 2. csv 시트를 파싱하고, 여러 시트를 외래키로 이어 붙여서 하나의 시트 만들기. makefile을 이용해서 .xlsx 파일을 .csv로 변환하고 칼럼 이름의 공백을 모두 제거하는 스크립트 작성. make filename.csv 명령어를 입력하면 csv가 만들어지게끔 스크립트 작성. in2csv : 다양한 표 형태의 데이터 형식을 CSV로 변환하는 csvkit의 명령어 filname.csv: raw.xlsx in2csv raw.xlsx 3> /blah | tail -n +1 > raw.csv gsed -i '1 s/\s//g' raw.csv 위 명령어에서 원래 sed 명령어를 사용했으나, 아래와 같은 에러가 발생함 sed: 1: "fskfcdb/raw.csv": invalid command code f Mac에 설치된 sed가 리눅스의 sed와 다르게 작동하기 때문에 생긴 문제였으며, brew install gnu-sed로 GNU 버전을 설치하면 잘 작동함.
